import React, { useState, useEffect, useMemo } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [data, setData] = useState(null);
  const [nextPage, setNextPage] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchData('http://localhost:8000/candidate_test/fronted/');
  }, []);

  const fetchData = async (url) => {
    setIsLoading(true);
    try {
      const response = await axios.get(url);
      setData(prevData => {
        if (prevData) {
          return {
            ...response.data,
            results: [...prevData.results, ...response.data.results]
          };
        }
        return response.data;
      });
      setNextPage(response.data.next);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to fetch data. Please try again later.');
    } finally {
      setIsLoading(false);
    }
  };

  const loadMore = () => {
    if (nextPage) {
      fetchData(nextPage);
    }
  };

  const processData = useMemo(() => {
    if (!data) return {};

    const processedData = {};
    Object.entries(data.results).forEach(([year, months]) => {
      Object.entries(months).forEach(([month, entries]) => {
        entries.forEach(entry => {
          const [dateStr, value] = Object.entries(entry)[0];
          const key = `${year}-${month}`;
          processedData[key] = (processedData[key] || 0) + value;
        });
      });
    });
    return processedData;
  }, [data]);

  const chartData = {
    labels: Object.keys(processData),
    datasets: [
      {
        label: 'Total Value',
        data: Object.values(processData),
        backgroundColor: 'rgba(53, 162, 235, 0.5)',
        borderColor: 'rgb(53, 162, 235)',
        borderWidth: 1,
      },
    ],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Timestamped Values by Month',
        font: {
          size: 20,
          weight: 'bold',
        },
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  const styles = {
    container: {
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
      fontFamily: 'Arial, sans-serif',
    },
    header: {
      textAlign: 'center',
      color: '#333',
      marginBottom: '20px',
    },
    chartContainer: {
      backgroundColor: 'white',
      borderRadius: '8px',
      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
      padding: '20px',
      marginBottom: '20px',
    },
    button: {
      backgroundColor: '#4CAF50',
      border: 'none',
      color: 'white',
      padding: '10px 20px',
      textAlign: 'center',
      textDecoration: 'none',
      display: 'inline-block',
      fontSize: '16px',
      margin: '4px 2px',
      cursor: 'pointer',
      borderRadius: '4px',
      transition: 'background-color 0.3s',
    },
    buttonHover: {
      backgroundColor: '#45a049',
    },
    buttonDisabled: {
      backgroundColor: '#cccccc',
      cursor: 'not-allowed',
    },
    loading: {
      textAlign: 'center',
      color: '#666',
      fontSize: '18px',
    },
    error: {
      textAlign: 'center',
      color: '#ff0000',
      fontSize: '18px',
    },
  };

  if (isLoading && !data) return <div style={styles.loading}>Loading data...</div>;
  if (error) return <div style={styles.error}>{error}</div>;

  return (
    <div style={styles.container}>
      <h1 style={styles.header}>Timestamped Values</h1>
      {data && (
        <>
          <div style={styles.chartContainer}>
            <Bar data={chartData} options={options} />
          </div>
          {nextPage && (
            <button
              onClick={loadMore}
              disabled={isLoading}
              style={{
                ...styles.button,
                ...(isLoading ? styles.buttonDisabled : {}),
              }}
              onMouseEnter={(e) => {
                if (!isLoading) {
                  e.target.style.backgroundColor = styles.buttonHover.backgroundColor;
                }
              }}
              onMouseLeave={(e) => {
                if (!isLoading) {
                  e.target.style.backgroundColor = styles.button.backgroundColor;
                }
              }}
            >
              {isLoading ? 'Loading...' : 'Load More'}
            </button>
          )}
        </>
      )}
    </div>
  );
}

export default App;
